import React from 'react';
import './add-item.styles.scss';

const AddItem = props => {
  const { onEditing } = props
  return(
    <div className="add-todo">
      ADD AN ITEM
      <div className="icon-plus" onClick={() => onEditing()}><i className="fa fa-plus"></i></div>
    </div>
  )
}

export default AddItem;
